function Start({start}) {


return (
    <div className="rating rating-hidden	">
   {(1 === Math.ceil(start))  ? <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400 disabled" checked onChange={false}  /> : <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400 disabled" />}
   {(2 === Math.ceil(start))  ? <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400 disabled" checked onChange={false} /> : <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400 disabled" />}
   {(3 === Math.ceil(start))  ? <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400 disabled" checked onChange={false}  /> : <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400 disabled" />}
   {(4 === Math.ceil(start)) ? <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400 disabled" checked onChange={false} /> : <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400 disabled" />}
   {(5 === Math.ceil(start))  ? <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400 disabled" checked onChange={false} /> : <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400  disabled" />}

    </div>
  )
}
export default Start
